-- Table structure for dl_member
-- ----------------------------
DROP TABLE IF EXISTS `dl_member`;
CREATE TABLE `dl_member` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '用户id，主键',
  `rid` varchar(100) NOT NULL DEFAULT '0' COMMENT '地区id',
  `type` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '类型：1-普通用户，2-收货人',
  `username` varchar(30) NOT NULL DEFAULT '' COMMENT '用户名',
  `company_name` char(20) NOT NULL DEFAULT '' COMMENT '公司名',
  `nickname` varchar(20) DEFAULT NULL COMMENT '昵称',
  `password` char(40) NOT NULL DEFAULT '' COMMENT '密码',
  `sex` tinyint(1) NOT NULL DEFAULT '1' COMMENT '性别',
  `tel` char(12) NOT NULL DEFAULT '' COMMENT '手机号码',
  `headimg` text NOT NULL COMMENT '头像',
  `openid` varchar(32) NOT NULL DEFAULT '' COMMENT '微信登录openid',
  `province` varchar(20) NOT NULL DEFAULT '' COMMENT '所在省',
  `city` varchar(20) NOT NULL COMMENT '所在城市',
  `area` varchar(20) NOT NULL DEFAULT '',
  `address` varchar(255) NOT NULL DEFAULT '' COMMENT '详细地址',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '状态: 1-已启用  0-未启用 ',
  `is_delete` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否删除：0-否，1-是',
  `money` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '可用收入',
  `integral` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '积分',
  `day_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '当日收入',
  `month_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '当月总收入',
  `total_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '总收入',
  `create_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '注册时间',
  `last_login_time` int(11) NOT NULL DEFAULT '0' COMMENT '上次登录时间 ',
  `last_login_ip` varchar(50) DEFAULT '0' COMMENT '上次登录ip',
  `current_day` int(11) NOT NULL DEFAULT '0' COMMENT '每日分享',
  PRIMARY KEY (`id`),
  KEY `username` (`username`) USING BTREE,
  KEY `tel` (`tel`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=14 DEFAULT CHARSET=utf8 COMMENT='会员表';

