-- ----------------------------
-- Table structure for dl_order
-- ----------------------------
DROP TABLE IF EXISTS `dl_order`;
CREATE TABLE `dl_order` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `town_id` int(11) NOT NULL DEFAULT '0' COMMENT '镇id',
  `order_sn` char(16) NOT NULL DEFAULT '' COMMENT '订单编号',
  `bar_code` char(16) NOT NULL DEFAULT '' COMMENT '条码',
  `uid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '下单用户ID',
  `goods_attrs` longtext COMMENT '回收物品，json格式',
  `goods_nums` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '商品总数',
  `freight_money` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '运费总金额',
  `address_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '收货地址ID',
  `address_info` longtext COMMENT '收货详细地址（下单地址快照）',
  `totalmoney` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '订单总价',
  `pay_type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '支付方式：1- 支付宝，2-微信，3-网银，4-其他',
  `is_pay` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否支付 , 0-待支付，1-已支付',
  `pay_time` int(11) NOT NULL DEFAULT '0' COMMENT '支付时间',
  `pay_openid` varchar(50) NOT NULL DEFAULT '' COMMENT '支付openid',
  `status` smallint(5) unsigned NOT NULL DEFAULT '1' COMMENT '订单状态: 1-未上门，2-未称重，3-已完成，4-已取消 ',
  `remark` varchar(500) NOT NULL DEFAULT '' COMMENT '备注',
  `is_delete` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否删除：0-正常，1-已删除',
  `create_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建订单时间',
  `sett_time` int(11) NOT NULL DEFAULT '0' COMMENT '结算时间',
  `is_sett` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否结算 1 已结算',
  PRIMARY KEY (`id`),
  UNIQUE KEY `ordersn` (`order_sn`) USING BTREE,
  KEY `member_id` (`uid`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=61 DEFAULT CHARSET=utf8 COMMENT='订单表';

